description:
Sexual Life (2005)

Inspired by Arthur Schnitzler's play &quot;La Ronde&quot;, this ensemble drama follows the sexual dynamics of eight different characters whose lives intersect through their shared partners, revealing their fears, hopes, heartbreaks, lies, secrets and the brutal truths behind closed doors. By constantly underlining the power of sex, the film manages to leave us with sympathy and compassion for those who simply cannot resist the force. Anne Heche, Elizabeth Banks, Kerry Washington, Tom Everett Scott, Azura Skye, Eion Bailey, Dule Hill, Carla Gallo and James Le Gros all star in this contemporary treatment of a timeless topic. And Director Ken Kwapis (The Sisterhood of the Traveling Pants) ensures that this carnal comedy of manners never misses a beat.       


